package Algorism;

public class Radar {
	private double min;
	private double max;
	
	public Radar(double min, double max) {
		// TODO Auto-generated constructor stub
		this.min=min;
		this.max=max;
	}
	public double getMin() {
		return min;
	}
	public void setMin(double min) {
		this.min = min;
	}
	public double getMax() {
	
		return max;
	}
	public void setMax(double max) {
		this.max = max;
	}
	
}
